Chatsworth

History Documentary hosted by Max Beesley, published by BBC in 2012 - English narration


Information
------------------------------

Chatsworth
Three-part documentary series detailing life of the new aristocracy over Chatsworth's entire 2011 season. For the first time ever, the palace of the peaks, Chatsworth House in Derbyshire, has opened its doors to the cameras for a whole year. It is a unique opportunity to take an in-depth glimpse of life upstairs and downstairs in the 21st century.




2)  Part 2 
This episode follows the duchess at the highlight of her social calendar, Chatsworth International Horse Trials. This year there is extra pressure on the duchess and course designer, Ian Stark, as the event is an official qualifier for the London Olympics, and everything must meet the governing body's exacting standards. The 2011 season sees the third annual Chatsworth flower festival, Florabundance. But there is a problem blooming in the gardens as the unseasonably warm spring weather is making the tulips flower ahead of schedule, leaving floral designer Jonathan Moseley 5,000 blooms short just days ahead of the grand opening. Chatsworth is one of the country's leading tourist destinations, which is a source of pride for the duke, duchess and their 700 staff. It is their attention to detail that pays dividends, but there are some serious problems that need ironing out when the public start complaining about the table setting in the grand dining room.



